/*
 * Sort a linked list in O(n log n) time using constant space complexity.
 */
/**
 * Definition for singly-linked list.
 * ListNode {
 *     int val;
 *     ListNode *next;
 *     ListNode(int x) : val(x), next(NULL) {}
 * };
 */

#include <iostream>
#include <vector>
#include <algorithm>
#include <ctime>
#include <chrono>
#include <random>
#include <cmath>

using namespace std;

struct ListNode {
    int val;
    ListNode *next;
    ListNode(int x) : val(x), next(NULL) {}
};

class Solution {
public:
    ListNode* sortList(ListNode* head) {
        if (NULL == head) return NULL;
        qsortList(head, NULL);
        return head;
    }

private:
    void qsortList(ListNode *start, ListNode *end) {
        if (NULL == start || start == end) return;
        ListNode *pslow, *pfast, *pmid;
        // pivot selection
        int maxVal = start->val, minVal = start->val, minDelta;
        for (pslow = start, pmid = start, minDelta = maxVal;
             pslow != end; pslow = pslow->next) {
            if (pslow->val > maxVal) maxVal = pslow->val;
            if (pslow->val < minVal) minVal = pslow->val;
            if (abs(pslow->val * 2 - maxVal - minVal) < minDelta) {
                pmid = pslow;
            }
        }
        if (minVal == maxVal) return;
        swap(start->val, pmid->val);
        pslow = start, pfast = start->next;
        while (pfast != end) {
            if (pfast->val < start->val) {
                pslow = pslow->next;
                swap(pslow->val, pfast->val);
            }
            pfast = pfast->next;
        }
        swap(pslow->val, start->val);
        qsortList(start, pslow);
        qsortList(pslow->next, end);
    }
};

ListNode *createListFromVector(const vector<int>& nums) {
    ListNode *head, *p;
    if (nums.empty()) {
        return NULL;
    }
    head = new ListNode(nums[0]); p = head;
    for (size_t i = 1; i < nums.size(); i++) {
        p->next = new ListNode(nums[i]);
        p = p->next;
    }
    return head;
}

void printList(ListNode *head) {
    ListNode *p = head;
    while (p != NULL) {
        cout << p->val << ", ";
        p = p->next;
    }
    cout << endl;
}

void destroyList(ListNode *head) {
    ListNode *p = head, *pNext;
    while (p != NULL) {
        pNext = p->next;
        delete p;
        p = pNext;
    }
}

void selectionSort(vector<int> &nums) {
    for (size_t i = 0; i < nums.size(); i++) {
        for (size_t j = i; j < nums.size(); j++) {
            if (nums[j] < nums[i]) {
                swap(nums[i], nums[j]);
            }
        }
    }
}

